import { Link } from "react-router-dom";
import { ArrowBackIcon } from "../Icons";
import Users from "../components/auth/Users";

const Admin = () => {
  return (
    <div id="admin">
      <Link to="/">
        <button className="btn">
          <ArrowBackIcon /> Back to Home
        </button>
      </Link>
      <Users />
    </div>
  );
};

export default Admin;
